import React from 'react'

 function Todolist(props) {
    const {completeTodo} =props
    let todoArr =props.todoArr.length > 0? props.todoArr : JSON.parse(localStorage.getItem('todos'))
  return (
    <div>
         <ul id="myList" class="ul">
            {todoArr && todoArr.length > 0 ? todoArr.map((el,i)=>(
         <li class="list"  id="list"  key={i}><div  className='list-items'>
        <input id="myCheckBox" type="checkbox" class="checkbox" onClick={()=> completeTodo(i)} className={el["done"]? "checked" : null ,"checkbox"} >
         </input><span>{el.title} </span></div><button  class="deletebtn"><i class="fa fa-trash" ></i></button></ li>)) : null}

        </ul>  
    </div>
  )
}


export default Todolist
